import React from 'react'
import ReactPlayer from 'react-player'
function videoPlayer() {
  return (
    <div className='video'>
        <ReactPlayer controls url="https://www.youtube.com/watch?v=xylh_sJAYdc"/>
    </div>
  )
}

export default videoPlayer;
